  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0089631 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise RR0913 in the
  North Pacific Ocean and Philippine Sea from 2009-10-17 to 2009-11-01. These data
  include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
  COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
  These data were collected by Donald Forsyth of Brown University and SCRIPPS INSTITUTION
  OF OCEANOGRAPHY as part of Depth Distribution of Anisotropic Fabric in the Oceanic
  Mantle. The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC
  as part of the NSF sponsored Rolling Deck to Repository (R2R) program. The ADCP
  data represent the raw and automated processed data set. Post processed quality
  assessed data are not available in this accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
